import { Link, useParams } from 'react-router-dom';

function ArtImageTile({ object }) {
    let { galleryId, artId } = useParams();
    return (
        <Link to={`/galleries/${galleryId}/art/${artId}`}>
            <img src={object.primaryimageurl}></img>
        </Link>

    );
}

export default ArtImageTile;
